import{_ as a,X as e,Y as r,Z as d}from"./framework-4ca3085c.js";const h={},i=d('<h1 id="javase知识体系" tabindex="-1"><a class="header-anchor" href="#javase知识体系" aria-hidden="true">#</a> JavaSE知识体系</h1><p>JavaSE 是 Java Platform, Standard Edition 的缩写，是 Java 平台中最基础、最核心的部分。它提供了 Java 编程语言的基础类库、Java 虚拟机（JVM）和 Java 开发工具包（JDK）等组成部分。</p><p>JavaSE 中的基础类库包括了 Java 编程语言的核心类库和辅助类库，如集合框架、输入/输出、网络通信、多线程、反射、XML解析、安全和加密等。JavaSE 还提供了 Java 虚拟机（JVM），它是一种能够在不同操作系统上运行 Java 程序的虚拟机，可以将 Java 代码转换成机器指令。</p><p>本部分主要对除 JVM 外的知识点进行梳理归纳。</p><h2 id="基础语法部分" tabindex="-1"><a class="header-anchor" href="#基础语法部分" aria-hidden="true">#</a> 基础语法部分</h2><ul><li><a href="/zh/md/java/1Java%E6%A6%82%E8%BF%B0">Java概述</a></li><li><a href="/zh/md/java/2Java%E5%9F%BA%E7%A1%80%E8%AF%AD%E6%B3%95">Java基础语法</a></li></ul><h2 id="面向对象部分" tabindex="-1"><a class="header-anchor" href="#面向对象部分" aria-hidden="true">#</a> 面向对象部分</h2><h2 id="高级辅助部分" tabindex="-1"><a class="header-anchor" href="#高级辅助部分" aria-hidden="true">#</a> 高级辅助部分</h2>',8),t=[i];function n(c,s){return e(),r("div",null,t)}const o=a(h,[["render",n],["__file","index.html.vue"]]);export{o as default};
